import React from 'react';
import ReactDOM from 'react-dom';
import Sampleform from './Heading';

var time = new Date(2020,2,2,10).getHours();
var Greetings = '';
if(time>=1 && time<12){
  Greetings = `Good Morning ... It's ${time}AM`;
}
else if(time>=12 && time<19){
  alert(`Good AfterNoon ... It's ${time}PM`)
}
else{
  alert(`Good Night ... It's ${time}PM`);
}


ReactDOM.render(
  <>
    <h1>{Greetings}</h1>
    <Sampleform />
  </>,
  document.getElementById("root")
);
